import React from 'react';
import { BrowserRouter as Router, Route, Switch, Link } from 'react-router-dom';

const App = () => {
  // Sample data for projects
  const projects = [
    {
      id: 1,
      title: 'Project 1',
      description: 'Lorem ipsum dolor sit amet, consectetur adipiscing elit.',
      imageUrl: 'https://via.placeholder.com/150',
    },
    {
      id: 2,
      title: 'Project 2',
      description: 'Pellentesque habitant morbi tristique senectus et netus et malesuada fames ac turpis egestas.',
      imageUrl: 'https://via.placeholder.com/150',
    },
  ];

  return (
    <Router>
      <div>
        <header style={headerStyle}>
          <nav style={navStyle}>
            <ul style={ulStyle}>
              <li style={liStyle}><Link to="/">Home</Link></li>
              <li style={liStyle}><Link to="/about">About</Link></li>
              <li style={liStyle}><Link to="/portfolio">Portfolio</Link></li>
              <li style={liStyle}><Link to="/contact">Contact</Link></li>
            </ul>
          </nav>
        </header>

        <main style={mainStyle}>
          <Switch>
            <Route exact path="/">
              <Home />
            </Route>
            <Route path="/about">
              <About />
            </Route>
            <Route path="/portfolio">
              <PortfolioPage projects={projects} />
            </Route>
            <Route path="/contact">
              <Contact />
            </Route>
          </Switch>
        </main>

        <footer style={footerStyle}>
          <p>&copy; 2024 Your Peer's Portfolio</p>
        </footer>
      </div>
    </Router>
  );
};

// Home component
const Home = () => (
  <div style={contentStyle}>
    <h2>Welcome to My Portfolio</h2>
    <p>Here you can learn more about my work and interests.</p>
  </div>
);

// About component
const About = () => (
  <div style={contentStyle}>
    <h2>About Me</h2>
    <p>I am passionate about technology and enjoy working on various projects.</p>
  </div>
);

// PortfolioPage component
const PortfolioPage = ({ projects }) => (
  <div style={contentStyle}>
    <h2>Portfolio</h2>
    {projects.map(project => (
      <Project key={project.id} project={project} />
    ))}
  </div>
);

// Project component
const Project = ({ project }) => (
  <div style={projectStyle}>
    <h3>{project.title}</h3>
    <img src={project.imageUrl} alt={project.title} style={imageStyle} />
    <p>{project.description}</p>
  </div>
);

// Contact component
const Contact = () => (
  <div style={contentStyle}>
    <h2>Contact Me</h2>
    <p>Feel free to reach out via email or social media.</p>
  </div>
);

// Inline styles for demonstration purposes
const headerStyle = {
  backgroundColor: '#333',
  color: '#fff',
  padding: '10px',
  marginBottom: '20px',
};

const navStyle = {
  display: 'flex',
  justifyContent: 'center',
};

const ulStyle = {
  listStyleType: 'none',
  padding: 0,
};

const liStyle = {
  margin: '0 10px',
};

const mainStyle = {
  padding: '20px',
};

const footerStyle = {
  textAlign: 'center',
  marginTop: '20px',
};

const contentStyle = {
  maxWidth: '800px',
  margin: '0 auto',
};

const projectStyle = {
  marginBottom: '20px',
  padding: '10px',
  border: '1px solid #ccc',
};

const imageStyle = {
  maxWidth: '100%',
  height: 'auto',
};

export default App;
